// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

// 所有需要实现升级的合约都应该继承此`AssetShellStore`合约,并且应该是首要第一个继承的父类
contract AssetShellStore {
	struct EnumerableSet_Set {
					bytes32[] _values;
					mapping(bytes32 => uint256) _indexes;
}
struct EnumerableSet_UintSet {
		EnumerableSet_Set _inner;
}
struct EnumerableSet_Bytes32Set {
				EnumerableSet_Set _inner;
}
struct EnumerableMap_Bytes32ToBytes32Map {
			EnumerableSet_Bytes32Set _keys;
			mapping(bytes32 => bytes32) _values;
}
struct EnumerableMap_UintToAddressMap {
		EnumerableMap_Bytes32ToBytes32Map _inner;
}
struct IAssetShell_AssetID {
			address token;
			uint256 tokenId;
}
struct AssetShell_AssetData {
		IAssetShell_AssetID meta;
		uint256 minimumPrice;
		address locked;
}
enum IAssetShell_SaleType {
 kDefault,kFirst,kSecond 
}

	address _impl;
	bool initialized;
	bool initializing;
	mapping(bytes4 => bool) _supportedInterfaces;
	address _host;
	address _operator;
	string _description;
	uint256[8] __;
	mapping(address => EnumerableSet_UintSet) _holderTokens;
	EnumerableMap_UintToAddressMap _tokenOwners;
	mapping(uint256 => address) _tokenApprovals;
	mapping(address => mapping(address => bool)) _operatorApprovals;
	string _name;
	string _symbol;
	mapping(uint256 => string) _tokenURIs;
	string _baseURI;
	string image;
	string external_link;
	address fee_recipient;
	uint32 seller_fee_basis_points;
	string contractURIPrefix;
	mapping(uint256 => AssetShell_AssetData) _assetsData;
	uint256 _lastLocked;
	IAssetShell_SaleType saleType;
	uint256[16] ___1; // impl address
}

// 这里的上下文是对外部暴露的合约实体只用来存储数据,实现的业务逻辑应该放到impl中
// 调用此合约的任何方法都会被导向`fallback()`中,然后使用`delegatecall()`调用实际实现并把当前数据上下文传递给impl
contract AssetShellProxy is AssetShellStore {
	// Layout Store 分配的大小应该是动态编译指定,需从原始合约读取存储大小

	constructor(address impl) public {
		// require(impl != address(0));
		_impl = impl;
	}

	fallback() external payable {
		//require(_impl != address(0), "Proxy call not implemented");
		(bool suc, bytes memory _data) = _impl.delegatecall(msg.data);
		assembly {
			let len := mload(_data)
			let data := add(_data, 0x20)
			switch suc
			case 0 { revert(data, len) }
			default { return(data, len) }
		}
	}
}
